prompt Creating BLOOD...
create table BLOOD
(
  sign CHAR(1) not null,
  type VARCHAR2(2) not null
)
;
alter table BLOOD
  add primary key (SIGN, TYPE)
;

prompt Creating COURSE...
create table COURSE
(
  course_id       NUMBER(5) not null,
  course_name     VARCHAR2(25) not null,
  course_date     DATE not null,
  course_location VARCHAR2(25) not null,
  price           FLOAT not null,
  hours           NUMBER(3) not null,
  instructor_id   NUMBER(9) not null
)
;
alter table COURSE
  add primary key (COURSE_ID)
;
alter table COURSE
  add constraint CHECK_NEGPRICE
  check (price >= 0);

prompt Creating DONATION_PLACE...
create table DONATION_PLACE
(
  place_id    NUMBER(5) not null,
  place_phone VARCHAR2(10) not null,
  manager     VARCHAR2(20) not null,
  address     VARCHAR2(25) not null
)
;
alter table DONATION_PLACE
  add primary key (PLACE_ID)
;

prompt Creating PERSON...
create table PERSON
(
  pid    VARCHAR2(9) not null,
  l_name VARCHAR2(10) not null,
  f_name VARCHAR2(10) not null,
  email  VARCHAR2(30)
)
;
alter table PERSON
  add primary key (PID)
;
alter table PERSON
  add constraint CHK_EMAIL_FORMAT
  check (INSTR(email, '@') > 0);

prompt Creating DONOR...
create table DONOR
(
  gender     CHAR(1) not null,
  birth_date DATE not null,
  donor_id   VARCHAR2(9) not null,
  sign       CHAR(1) not null,
  type       VARCHAR2(2) not null
)
;
alter table DONOR
  add primary key (DONOR_ID)
;
alter table DONOR
  add foreign key (DONOR_ID)
  references PERSON (PID);
alter table DONOR
  add foreign key (SIGN, TYPE)
  references BLOOD (SIGN, TYPE);

prompt Creating PARAMEDIC...
create table PARAMEDIC
(
  license_num  NUMBER(5) not null,
  seniority    NUMBER(2) default 0,
  paramedic_id VARCHAR2(9) not null,
  salary       NUMBER(6) default 0
)
;
alter table PARAMEDIC
  add primary key (PARAMEDIC_ID)
;
alter table PARAMEDIC
  add foreign key (PARAMEDIC_ID)
  references PERSON (PID);

prompt Creating RECEIVER...
create table RECEIVER
(
  hospital_id    NUMBER(5) not null,
  hospital_name  VARCHAR2(20) not null,
  city           VARCHAR2(15) not null,
  delivery_date  DATE not null,
  hospital_phone VARCHAR2(10) not null
)
;
alter table RECEIVER
  add primary key (HOSPITAL_ID)
;

prompt Creating DONATION...
create table DONATION
(
  donation_id   NUMBER(10) not null,
  pass_tests    CHAR(1),
  donation_date DATE not null,
  valid         CHAR(1),
  paramedic_id  VARCHAR2(9) not null,
  donor_id      VARCHAR2(9) not null,
  place_id      NUMBER(5) not null,
  hospital_id   NUMBER(5)
)
;
alter table DONATION
  add primary key (DONATION_ID)
;
alter table DONATION
  add foreign key (PARAMEDIC_ID)
  references PARAMEDIC (PARAMEDIC_ID);
alter table DONATION
  add foreign key (DONOR_ID)
  references DONOR (DONOR_ID);
alter table DONATION
  add foreign key (PLACE_ID)
  references DONATION_PLACE (PLACE_ID);
alter table DONATION
  add foreign key (HOSPITAL_ID)
  references RECEIVER (HOSPITAL_ID);
alter table DONATION
  add constraint CHK_PASS_TEST_VALID
  check (pass_tests = 'N' AND valid IS NULL OR pass_tests != 'N');

prompt Creating TCATEGORY...
create table TCATEGORY
(
  category_location VARCHAR2(90) not null,
  category_name     VARCHAR2(90) not null,
  supervisor        VARCHAR2(50) not null
)
;
alter table TCATEGORY
  add primary key (CATEGORY_NAME)
;

prompt Creating TOOL...
create table TOOL
(
  weight        FLOAT not null,
  tool_name     VARCHAR2(55) not null,
  made_in       VARCHAR2(50) not null,
  color         VARCHAR2(15) not null,
  category_name VARCHAR2(50) not null,
  donation_id   NUMBER(10)
)
;
alter table TOOL
  add primary key (TOOL_NAME)
;
alter table TOOL
  add constraint FK_TOOL_DONATION foreign key (DONATION_ID)
  references DONATION (DONATION_ID);
alter table TOOL
  add foreign key (CATEGORY_NAME)
  references TCATEGORY (CATEGORY_NAME);

prompt Creating COURSE_TOOL...
create table COURSE_TOOL
(
  tool_name VARCHAR2(35) not null,
  course_id NUMBER(5) not null
)
;
alter table COURSE_TOOL
  add primary key (TOOL_NAME, COURSE_ID)
;
alter table COURSE_TOOL
  add foreign key (TOOL_NAME)
  references TOOL (TOOL_NAME);
alter table COURSE_TOOL
  add foreign key (COURSE_ID)
  references COURSE (COURSE_ID);

prompt Creating INSTRUCTOR...
create table INSTRUCTOR
(
  qualification     VARCHAR2(20) not null,
  instructor_salary NUMBER(7,2),
  instructor_id     VARCHAR2(9)
)
;
alter table INSTRUCTOR
  add constraint INSTRUCTOR_FK foreign key (INSTRUCTOR_ID)
  references PERSON (PID);

prompt Creating PARTICIPANT...
create table PARTICIPANT
(
  address        VARCHAR2(50),
  birth_date     DATE default SYSDATE not null,
  participant_id VARCHAR2(9) not null
)
;
alter table PARTICIPANT
  add constraint PARTICIPANT_PK primary key (PARTICIPANT_ID)
;
alter table PARTICIPANT
  add constraint PARTICIPANT_FK foreign key (PARTICIPANT_ID)
  references PERSON (PID);

prompt Creating PERSON_PHONE_NUMBER...
create table PERSON_PHONE_NUMBER
(
  phone_number VARCHAR2(12) not null,
  pid          VARCHAR2(9) not null
)
;
alter table PERSON_PHONE_NUMBER
  add primary key (PHONE_NUMBER, PID)
;
alter table PERSON_PHONE_NUMBER
  add foreign key (PID)
  references PERSON (PID);
alter table PERSON_PHONE_NUMBER
  add constraint CHK_PERSON_PHONE
  check (phone_number LIKE '0%');

prompt Creating REGISTRATION...
create table REGISTRATION
(
  registration_date DATE not null,
  registration_time VARCHAR2(5) not null,
  status            VARCHAR2(15) not null,
  registration_id   NUMBER(5) not null,
  payment_method    VARCHAR2(15) not null,
  participant_id    NUMBER(9) not null,
  course_id         NUMBER(5) not null
)
;
alter table REGISTRATION
  add primary key (REGISTRATION_ID)
;
alter table REGISTRATION
  add foreign key (COURSE_ID)
  references COURSE (COURSE_ID);

